function Search(elem) {
  console.log(elem.imput.value);
}

function SearchBar() {
  return (
    <form onSubmmit={Search(this)}>
      <imput type="text" placeHolder="Digite sua pesquisa" />
      <button type="submmit">
        <img src="./img/pesquisar.png" alt="pesq" />
      </button>
    </form>
  );
}

export default SearchBar;
